import './App.css';

function App() {
  const names = ["Corey", "Rob", ];
  const items = [];

  for (const name in names) {
    items.push(<li>{name}</li>);
  }
  return (

    <div className="container">
      <h1>Hello From React</h1>
      <ul>{ items }</ul>
    </div>
  );
}

export default App;
